(window.webpackJsonp=window.webpackJsonp||[]).push([[115],{1069:function(s){s.exports={content:'<h2>\u56de\u987e</h2>\n<p>\u5728\u8fd9\u4e00\u7247\u6587\u7ae0\u4e2d\uff0c\u6211\u6784\u5efa\u4e00\u4e2a\u83b7\u53d6\u51fd\u6570\u53c2\u6570\u540d\u7684\u5de5\u5177\uff0c\u662f\u901a\u8fc7<code>esprima</code>\u53bb\u89e3\u6790<code>AST</code>\u5e76\u5bf9\u5176\u8fdb\u884c\u5206\u6790\u5224\u65ad\u3002</p>\n<p>\u901a\u8fc7\u5bf9<code>AST</code>\u7684\u5206\u6790\uff0c\u51e0\u4e4e\u80fd\u517c\u5bb9\u6240\u6709\u51fd\u6570\u548c\u53c2\u6570\u7684\u5199\u6cd5\uff0c\u8fd9\u662f\u56e0\u4e3a\u5b83\u662f\u4ece\u8bed\u4e49\u4e0a\u5206\u6790\u4ee3\u7801\u3002</p>\n<h2>\u95ee\u9898</h2>\n<p>\u4f46\u4f7f\u7528\u7684\u540c\u65f6\uff0c\u4e5f\u53d1\u73b0\u4e863\u4e2a\u95ee\u9898\uff0c<strong>\u7b2c1\u4e2a\u662f\u81f4\u547d\u7684</strong>\u3002</p>\n<ol>\n<li>\n<p>babel\u7f16\u8bd1\u3002</p>\n<p>\u5f53\u6211\u4eec\u5f88\u723d\u7684\u5199\u7740ES6\u51fd\u6570\u7684\u65f6\u5019\uff0c<code>babel</code>\u4f1a\u5c06\u4f60\u7684\u53c2\u6570\u683c\u5f0f\u5f7b\u5e95\u6253\u4e71\u3002</p>\n<p>\u4f8b\u5982\uff1a</p>\n<pre class="hljs"><code><span class="hljs-keyword">let</span> sum=<span class="hljs-function">(<span class="hljs-params">a=<span class="hljs-number">2</span>,b=<span class="hljs-number">3</span></span>)=&gt;</span>{\n  <span class="hljs-built_in">console</span>.log(a+b)\n}\n</code></pre>\n<p>\u7f16\u8bd1\u540e\uff0c\u6ca1\u6709\u53c2\u6570\u4e86\uff0c\u5de5\u5177\u5f7b\u5e95\u5931\u6548\u3002</p>\n<pre class="hljs"><code><span class="hljs-keyword">var</span> sum = <span class="hljs-function"><span class="hljs-keyword">function</span> <span class="hljs-title">sum</span>(<span class="hljs-params"></span>) </span>{\n  <span class="hljs-keyword">var</span> a = <span class="hljs-built_in">arguments</span>.length &gt; <span class="hljs-number">0</span> &amp;&amp; <span class="hljs-built_in">arguments</span>[<span class="hljs-number">0</span>] !== <span class="hljs-literal">undefined</span> ? <span class="hljs-built_in">arguments</span>[<span class="hljs-number">0</span>] : <span class="hljs-number">2</span>;\n  <span class="hljs-keyword">var</span> b = <span class="hljs-built_in">arguments</span>.length &gt; <span class="hljs-number">1</span> &amp;&amp; <span class="hljs-built_in">arguments</span>[<span class="hljs-number">1</span>] !== <span class="hljs-literal">undefined</span> ? <span class="hljs-built_in">arguments</span>[<span class="hljs-number">1</span>] : <span class="hljs-number">3</span>;\n  <span class="hljs-built_in">console</span>.log(a + b);\n};\n</code></pre>\n</li>\n<li>\n<p>\u52a8\u6001\u7f16\u8bd1\u3002</p>\n<p>\u5fc5\u987b\u8981\u7b49\u5230\u7a0b\u5e8f\u5f00\u59cb\u8fd0\u884c\u540e\u624d\u80fd\u5de5\u4f5c\uff0c\u8fd9\u610f\u5473\u7740\u8981\u5c06\u6574\u4e2a<code>esprima</code>\u5e93\u653e\u5165\u5230\u9879\u76ee\u4e2d\uff0c\u9664\u975e\u4f60\u7684\u9879\u76ee\u4e2d\u5df2\u7ecf\u6709\u4f9d\u8d56\n<code>esprima</code>\uff0c\u5426\u5219\u4e3a\u8fd9\u4e2a\u529f\u80fd\u4f1a\u5e26\u6765\u989d\u5916\u7684\u4f53\u79ef\u5f00\u9500\u3002</p>\n</li>\n<li>\n<p>\u6027\u80fd\u3002</p>\n<p>\u7531\u4e8e\u662f\u8fd0\u884c\u65f6\u624d\u5f00\u59cb\u6267\u884c\u5206\u6790<code>AST</code>\u6811\uff0c\u8fd9\u610f\u5473\u7740\u4f60\u7684\u9996\u5c4f\u65f6\u95f4\u53c8\u53cc\u53d2\u53d5\u589e\u52a0\u4e86...</p>\n</li>\n</ol>\n<h2>\u89e3\u51b3\u65b9\u6848</h2>\n<p>\u5f53\u524d\u6700\u9700\u8981\u89e3\u51b3\u7684\u5c31\u662f\u5982\u679c\u9002\u5e94babel\u7f16\u8bd1\u3002</p>\n<p>\u5f88\u663e\u7136\uff0c\u90a3\u5c31\u662f\u8981\u62a2\u5728babel\u7f16\u8bd1\u4e4b\u524d\uff0c\u8fd9\u5c31\u8bf7\u51fa\u4eca\u5929\u7684\u4e3b\u89d2\uff0c<strong>babel\u63d2\u4ef6</strong>\u3002</p>\n<p>\u9996\u5148\u7b80\u8981\u8bf4\u660e\u4e00\u4e0b\uff0cbabel\u662f\u600e\u4e48\u7f16\u8bd1\u4f60\u7684\u4ee3\u7801\u7684\uff0c<code>AST</code>\u6811\u3002</p>\n<p>\u4f8b\u5982\u4e0a\u9762\u7684\u51fd\u6570</p>\n<pre class="hljs"><code><span class="hljs-keyword">let</span> sum=<span class="hljs-function">(<span class="hljs-params">a=<span class="hljs-number">2</span>,b=<span class="hljs-number">3</span></span>)=&gt;</span>{\n  <span class="hljs-built_in">console</span>.log(a+b)\n}\n</code></pre>\n<p>babel\u4f1a\u68c0\u6d4b\u5230\u662f\u4e00\u4e2a<code>ArrowFunctionExpression(\u7bad\u5934\u51fd\u6570\u8868\u8fbe\u5f0f)</code>\uff0c\u7136\u540e\u7ee7\u7eed\u68c0\u6d4b\uff0c\n\u53d1\u73b0\u53c2\u6570\u662f<code>ExpressionStatement(\u8868\u8fbe\u5f0f\u8bed\u53e5)</code>\uff0c\u7b26\u5408\u4fee\u6539\u7684\u8981\u6c42\uff0c\u4e8e\u662f\u6784\u9020\u51fa\u8fd9\u4e24\u53e5\u7684<code>AST</code>\u6811</p>\n<pre class="hljs"><code><span class="hljs-keyword">var</span> a = <span class="hljs-built_in">arguments</span>.length &gt; <span class="hljs-number">0</span> &amp;&amp; <span class="hljs-built_in">arguments</span>[<span class="hljs-number">0</span>] !== <span class="hljs-literal">undefined</span> ? <span class="hljs-built_in">arguments</span>[<span class="hljs-number">0</span>] : <span class="hljs-number">2</span>;\n<span class="hljs-keyword">var</span> b = <span class="hljs-built_in">arguments</span>.length &gt; <span class="hljs-number">1</span> &amp;&amp; <span class="hljs-built_in">arguments</span>[<span class="hljs-number">1</span>] !== <span class="hljs-literal">undefined</span> ? <span class="hljs-built_in">arguments</span>[<span class="hljs-number">1</span>] : <span class="hljs-number">3</span>;\n</code></pre>\n<p>\u5176\u4e2d\u4e00\u6761<code>var a=...</code>\u7684<code>AST</code>\u5982\u4e0b\uff0c\u5177\u4f53\u53ef\u4ee5\u8fd9\u91cc\u5c1d\u8bd5\uff0c<a href="https://astexplorer.net/">https://astexplorer.net/</a></p>\n<p><img src="https://stonehank.github.io/articles/img/AST-sample.png" alt="./img/AST-sample.png"></p>\n<p>\u5e76\u5c06\u5176\u63d2\u5165\u5230\u5f53\u524d\u7684<code>BlockStatement(\u5927\u62ec\u53f7\u4f5c\u7528\u57df\u5185)</code></p>\n<p>\u68c0\u6d4b\u548c\u6784\u9020\uff0c\u5c31\u662fbabel\uff0c\u4e5f\u662fbabel\u63d2\u4ef6\u7684\u6838\u5fc3\u3002</p>\n<h2>AST\u8282\u70b9\u4fee\u6539</h2>\n<p>\u6b63\u5f0f\u5f00\u59cb\uff0c\u5148\u4ece\u4e00\u4e2a\u7b80\u5355\u7684\u7ed3\u6784\u770b\u8d77\uff0c\u4e00\u4e2a\u5b98\u65b9\u63d2\u4ef6<code>@babel/plugin-transform-object-assign</code>\uff0c\u4f5c\u7528\u662f\u5c06<code>Object.assign</code>\n\u8f6c\u6362\u6210<code>_extends</code>\uff0c\u8fd9\u4e2a<code>_extends</code>\u662f\u4e00\u4e2a\u9884\u5b9a\u4e49\u7684\u65b9\u6cd5\u3002</p>\n<pre class="hljs"><code><span class="hljs-keyword">import</span> { declare } <span class="hljs-keyword">from</span> <span class="hljs-string">"@babel/helper-plugin-utils"</span>;\n<span class="hljs-keyword">export</span> <span class="hljs-keyword">default</span> declare(<span class="hljs-function"><span class="hljs-params">api</span> =&gt;</span> {\n  api.assertVersion(<span class="hljs-number">7</span>);\n<span class="hljs-comment">/*----------\u4ee5\u4e0a\u662f\u786e\u8ba4\u7248\u672c\u5224\u65ad\u529f\u80fd\u662f\u5426\u5b58\u5728---------*/</span>\n  <span class="hljs-keyword">return</span> {\n    <span class="hljs-attr">visitor</span>: {\n      <span class="hljs-attr">CallExpression</span>: <span class="hljs-function"><span class="hljs-keyword">function</span>(<span class="hljs-params">path, file</span>) </span>{\n        <span class="hljs-keyword">if</span> (path.get(<span class="hljs-string">"callee"</span>).matchesPattern(<span class="hljs-string">"Object.assign"</span>)) {\n          path.node.callee = file.addHelper(<span class="hljs-string">"extends"</span>);\n        }\n      },\n    },\n  };\n});\n</code></pre>\n<p>\u4ece\u7b2c6\u884c\u5f00\u59cb</p>\n<ul>\n<li>\n<p><code>visitor</code>\u6307\u7684\u662f\u8bbf\u95ee\u8005\u6a21\u5f0f\uff0c\u7b80\u5355\u6765\u8bf4\u5c31\u662f\u6211\u4eec\u904d\u5386<code>AST</code>\u6811\uff0c\u6bcf\u6b21\u904d\u5386\u4e00\u4e2a\u8282\u70b9\uff0c\u90fd\u4f1a\u8fdb\u5165visitor\u6267\u884c\u6211\u4eec\u7684\u4ee3\u7801\u3002</p>\n</li>\n<li>\n<p><code>CallExpression</code>\u8bf4\u660e\u6211\u4eec\u8981\u627e\u7684\u76f8\u5173\u8bed\u4e49\u662f<code>\u8c03\u7528\u8868\u8fbe\u5f0f</code>\uff0c\u5b83\u662f\u4e00\u4e2a\u51fd\u6570\uff0c\u67092\u4e2a\u53c2\u6570<code>path</code>\u548c<code>file</code>\uff0c</p>\n</li>\n<li>\n<p><code>file</code>\u8fd9\u91cc\u8c03\u7528\u4e86addHelper\u65b9\u6cd5\uff0c\u7528\u7684\u6bd4\u8f83\u5c11\uff0c\u6682\u65f6\u6401\u7740\u3002</p>\n</li>\n<li>\n<p><code>path</code>\u76f8\u5f53\u662f\u4e00\u4e2a\u8fde\u63a5\u5bf9\u8c61\uff0c\u5b83\u91cc\u9762\u7684\u5c5e\u6027\u53ef\u4ee5\u8fde\u63a5\u5230\u5404\u4e2a\u6211\u4eec\u9700\u8981\u7684\u5bf9\u8c61\uff0c\u4f8b\u5982\u5982\u679c\u6211\u4eec\u8981\u627e\u5230<code>CallExpression</code>\u5bf9\u8c61\u672c\u8eab\uff0c\n\u90a3\u4e48\u5c31\u662f\u8fdb\u5165<code>path.node</code>\uff0c\u5982\u679c\u8981\u627e\u5b83\u7684\u7236\u8282\u70b9\uff0c\u8fdb\u5165<code>path.parent</code>\u7b49\u7b49</p>\n<blockquote>\n<p>\u4e2a\u4eba\u7406\u89e3\uff1a\u8981\u5c3d\u5feb\u8fdb\u5165<code>path.node</code>\uff0c\u800c\u4e0d\u8981\u5728<code>path</code>\u4e0a\u505a\u8fc7\u591a\u5224\u65ad\u751a\u81f3\u662f\u904d\u5386\uff0c\n\u56e0\u4e3a\u5b83\u662f\u4e00\u4e2a\u5305\u542b\u4e86\u6240\u6709\u8282\u70b9\u7684path\u7684\u5bf9\u8c61\uff0c\u5b83\u7684\u4f5c\u7528\u5c31\u662f\u8ba9\u6211\u4eec\u5feb\u901f\u5230\u8fbe\u60f3\u8981\u627e\u7684\u8282\u70b9\uff0c\n\u5982\u679c\u5728<code>path</code>\u4e0a\u9762\u4e00\u5c42\u5c42\u5bfb\u627e(\u6211\u5c31\u8fd9\u4e48\u5e72\u4e86\uff01)\uff0c\u8eab\u5fc3\u4ff1\u75b2...</p>\n</blockquote>\n</li>\n</ul>\n<p>\u7ee7\u7eed\u56de\u5230\u4f8b\u5b50</p>\n<ul>\n<li>\n<p><code>path.get(&quot;callee&quot;)</code>\uff0c\u56e0\u4e3a\u8fd9\u662f\u4e00\u4e2a<code>CallExpression</code>\uff0c\u5b83\u4e00\u5b9a\u6709\u4e00\u4e2a<code>callee</code>\u5c5e\u6027\uff0c\n\u901a\u8fc7<code>.get</code>\u53ef\u4ee5\u5feb\u901f\u67e5\u627e\uff0c\u76f8\u5f53\u4e8e<code>path.node.callee</code>\u3002</p>\n</li>\n<li>\n<p><code>.matchesPattern(&quot;Object.assign&quot;)</code>\u5b57\u9762\u610f\u601d\uff0c\u5339\u914d\u5230<code>Object.assign</code>\u8fd9\u4e2a\u5b57\u6837\u3002</p>\n</li>\n<li>\n<p><code>path.node.callee = file.addHelper(&quot;extends&quot;)</code>\u5c31\u662f\u5c06<code>callee</code>\u5c5e\u6027\u91cd\u65b0\u8bbe\u7f6e\u6210<code>_extend</code>\uff0c\n\u8fd9\u91cc\u7684<code>file.addHelper(&quot;extends&quot;)</code>\u8fd4\u56de\u7684\u4e5f\u662f\u4e00\u4e2a<code>AST</code>\u5bf9\u8c61\uff0c<code>Identifier{type:&quot;Identifier &quot;,name:&quot;_extend&quot;}</code>\uff0c\n\u8fd9\u662f\u4e00\u4e2a\u6807\u8bc6\u7b26\uff0c\u50cf\u53d8\u91cf\uff0c\u53c2\u6570\uff0c\u5c5e\u6027\u7684\u540d\u79f0\u7b49\u90fd\u662f\u6807\u8bc6\u7b26\u3002</p>\n<p>\u8bb0\u4f4f\uff0c\u8981\u5728<code>AST</code>\u6811\u4e0a\u63d2\u5165\u7684\u5185\u5bb9\u4e00\u5b9a\u4e5f\u8981\u662f<code>AST</code>\u5bf9\u8c61\u3002</p>\n</li>\n</ul>\n<p>\u770b\u5230\u5417\uff0c\u5c31\u8fd9\u4e48\u591a\uff0c\u5f88\u597d\u7406\u89e3\u5427\uff0c\u56e0\u4e3a\u8fd9\u91cc\u53ea\u662f\u4fee\u6539\u4e86\u4e00\u4e2a\u5c5e\u6027\uff0c\u5e76\u6ca1\u6709\u589e\u52a0\u3002</p>\n<h2>AST\u8282\u70b9\u589e\u52a0</h2>\n<p>\u5728\u8fd9\u4e00\u5757\uff0c\u6211\u88ab\u56f0\u6270\u4e86\u597d\u51e0\u4e2a\u5c0f\u65f6\uff0c\u4e3b\u8981\u8fd8\u662f\u6982\u5ff5\u592a\u8fc7\u7f3a\u5931\uff0c\u73b0\u5728\u603b\u7ed3\u8d77\u6765\u3002</p>\n<ol>\n<li>\n<p>\u6bcf\u4e00\u4e2aAST\u8282\u70b9\u90fd\u662f\u4e00\u4e2a\u5bf9\u8c61\uff0c\u8fd9\u4e2a\u5bf9\u8c61\u5185\u90e8\u6709\u5fc5\u987b\u7684\u5c5e\u6027(type\u662f\u5fc5\u987b\u7684)\uff0c\u4e5f\u6709\u975e\u5fc5\u987b\u7684\u5c5e\u6027\uff0c\u4f8b\u5982\uff1a</p>\n<p><code>ArrayExpression(\u6570\u7ec4\u8868\u8fbe\u5f0f)</code>\uff0c\u4e5f\u5c31\u662f\u6570\u7ec4\uff0c\u5fc5\u987b\u7684\u5c5e\u6027\u53ea\u67091\u4e2a\uff0c<code>elements</code>\uff0c\u5b83\u7684\u5143\u7d20</p>\n<p>\u90a3\u4e48\u5c31\u53ef\u4ee5\u60f3\u8c61\u4e00\u4e0b\uff0c\u5b83\u7684\u6700\u7b80\u5355<code>AST</code>\u6811\u7ed3\u6784\u5c31\u662f</p>\n<pre class="hljs"><code>{\n  type:&quot;ArrayExpression&quot;,\n  elements:[]\n}\n</code></pre>\n<p>\u4f46\u67e5\u627e\u65f6\u4f1a\u53d1\u73b0\uff0c\u9ed8\u8ba4\u7684\u6811\u8fd8\u6709\u5176\u4ed6\u8bb8\u591a\u5c5e\u6027\uff0c\u4f8b\u5982<code>start</code>,<code>loc</code>\u7b49\u7b49\uff0c\u8fd9\u4e9b\u6211\u4eec\u5728\u521b\u5efa\u7684\u65f6\u5019\uff0c\u53ef\u4ee5\u4e0d\u5fc5\u7406\u4f1a\u3002</p>\n</li>\n<li>\n<p>\u521b\u5efa\u65b9\u5f0f\u6709\u591a\u79cd\uff0c\u5206\u4e3a2\u7c7b\uff0c\u4f7f\u7528\u5de5\u5177\u521b\u5efa\u548c\u4e0d\u4f7f\u7528\u5de5\u5177\u521b\u5efa\u3002</p>\n<p>\u5f53\u7136\uff0c\u6700\u5f00\u59cb\u6211\u662f\u4e0d\u4f7f\u7528\u5de5\u5177\u7684\uff0c\u5f53\u65f6\u5199\u4e00\u4e2a\u5bf9\u8c61\u7ed3\u6784\u91cc\u9762\u7684<code>key</code>\u5c5e\u6027\u662f\u5b57\u7b26\u4e32\uff0c<code>value</code>\u5c5e\u6027\u662f\u6570\u7ec4(\u5e76\u4e14\u6709\u7684\u6709\u53ef\u80fd\u591a\u5c42\u5d4c\u5957)\uff0c\n\u7136\u540e\u5f00\u59cb\u4e00\u4e2a\u4e2a\u8282\u70b9\u5bf9\u8c61\u521b\u5efa\uff0c\u9012\u5f52\uff0c\u904d\u5386\uff0c\u5199\u554a\u5199\uff0c\u5199\u5b8c\u6267\u884c\uff0c\u5931\u8d25\uff0c\u597d\u5427\uff0c\u4e00\u5c42\u4e00\u5c42\u7684\u5265\u5f00\u8c03\u8bd5...\u8fd9\u5c31\u662f\u5199bug\u7684\u6b63\u786e\u65b9\u5f0f\u3002</p>\n<p>\u597d\u5427\uff0c<code>ctrl+a -&gt; del</code>\uff0c\u8fd9\u91cc\u53ea\u8bb2\u6211\u4f7f\u7528\u7684\u65b9\u5f0f\u3002</p>\n<p>\u5b89\u88c5<code>@babel/core</code>\uff0c\u5f15\u5165<code>import {template,types as t} from &quot;@babel/core&quot;</code></p>\n<ul>\n<li><code>template</code></li>\n</ul>\n<p>\u7528\u6765\u521b\u5efa\u6a21\u677f\u7684\uff0c\u80fd\u5c11\u5199\u5f88\u591a\u4e1c\u897f\uff0c\u4f8b\u5982\uff1a<code>template(&quot;let x=SOMEVALUE&quot;)</code>\n\u8fd9\u91cc\u53ea\u9700\u8981\u5728\u540e\u9762\u4f20\u5165<code>SOMEVALUE(\u8981\u5927\u5199)</code>\u7684\u503c\uff0c\u5c31\u4f1a\u81ea\u52a8\u521b\u5efa\u51fa<code>let x=xxxx</code>\u8fd9\u4e2a\u8868\u8fbe\u5f0f\u7684<code>AST</code>\u5bf9\u8c61\u3002</p>\n<ul>\n<li><code>types</code></li>\n</ul>\n<p>\u7528\u6765\u521b\u5efa\u5355\u4e2a\u8282\u70b9\u5bf9\u8c61\u7684\u3002\n\u6216\u8bb8\u6211\u53ea\u60f3\u7b80\u5355\u521b\u5efa\u4e00\u4e2a\u5b57\u7b26\u4e32\uff0c\u90a3\u4e48\u5c31\u662f<code>t.stringLiteral(&quot;\u8fd9\u91cc\u662f\u8981\u521b\u5efa\u7684\u5b57\u7b26\u4e32&quot;)</code>\uff0c</p>\n<p>\u521b\u5efa\u4e00\u4e2a\u6570\u7ec4\uff0c\u90a3\u4e48\u662f<code>t.arrayExpression(elements)</code>\uff0c</p>\n<p>\u4e5f\u5c31\u662f\u4f7f\u7528<code>t</code>\u7684\u8282\u70b9\u540d\u79f0\u65b9\u6cd5\uff0c\u4f20\u5165\u8fd9\u4e2a\u8282\u70b9\u5fc5\u987b\u7684\u5c5e\u6027\u5c31\u53ef\u4ee5\u4e86\uff0c\u4f60\u53ea\u9700\u8981\u4e86\u89e3\u4f60\u7684\u4ee3\u7801\u5bf9\u5e94\u7684\u8bed\u4e49\uff0c\n\u6700\u540e\u62fc\u63a5\uff0c\u4f8b\u5982 \u4e00\u4e2a\u67093\u4e2a\u5b57\u7b26\u4e32\u4f5c\u4e3a\u5143\u7d20\u7684\u6570\u7ec4\uff1a</p>\n<p><code>t.arrayExpression([t.stringLiteral(&quot;a&quot;),t.stringLiteral(&quot;b&quot;),t.stringLiteral(&quot;c&quot;)])</code></p>\n<p>\u7b80\u6d01\u9ad8\u6548\u3002</p>\n</li>\n</ol>\n<h2>\u603b\u7ed3</h2>\n<p>\u5173\u4e8eAST\u7684\u64cd\u4f5c\u8fd8\u6709\u5f88\u591a\uff0c\u4f8b\u5982\u5220\u9664\uff0c\u66ff\u6362...\u5177\u4f53\u53ef\u4ee5\u770b<code>bable-handbook</code>\uff0c\u8fd9\u7bc7\u6587\u7ae0\u8bf4\u7684\u4fee\u6539\u548c\u589e\u52a0\uff0c\u5185\u5bb9\u4e0d\u6df1\uff0c\u4e3b\u8981\u662f\u8ba9\u6211\u4eec\u5bf9AST\n\u7684\u7ed3\u6784\uff0c\u5e76\u4e14\u662f\u5982\u4f55\u901a\u8fc7\u5b83\u53bb\u521b\u5efababel\u63d2\u4ef6\u80fd\u6709\u4e00\u4e2a\u6982\u5ff5\uff0c\u63a5\u4e0b\u6765\u7684\u66f4\u591a\u53d1\u6398\u5c31\u9760\u81ea\u5df1\u7684\u63a2\u7d22\u4e86\u3002</p>\n'}}}]);
